import React from 'react';

// Components
import Input from '../UI/Input';

// CSS
import styles from './Search.module.scss';

const Search = () => {
    return (
        <div className={styles.search}>
            <Input customclass={styles['search-input']} />
        </div>
    )
};

export default Search;
